<script>
   function m(s, t) {
    s = s.toString().split('').sort().join('');
    t = t.toString().split('').sort().join('');
    for (var i = 0; i < s.length; i++) {
        if (s[i] !== t[i]) {
            return t[i];
        }
    }
    return t[t.length - 1]; 
}
console.log(m(123456, 1234567));
    



</script>
